import AllPosts from './Home';
import './App.css';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <div className="App flex-column">
        <AllPosts></AllPosts>
      </div>
    </div>
  );
}

export default App;

